INSERT INTO `skills` (`skillId`, `skillType`, `skillDesc`, `createdDate`, `modifiedDate`, `createdBy`, `modifiedBy`, `status`) VALUES
	('SK0001', 'Work', ' Experienced on UC4 application technology and monitoring support so as to perform the following activities: \r\n Verify failures and long running jobs scheduled on SAP, Windows and Unix environments\r\n Error log analysis for troubleshooting\r\n System outages and incident handling\r\n Create notification to responsible team or user according to documentation\r\n Monitor and follow up open notifications and Incidents in ITSM\r\n Monitor shared mailbox for on demand execution requests and consulting\r\n Provide customer support through global hotline phone calls\r\n UC4 obsolete objects deletion\r\n System maintenance support on working hours (disruptive windows) and weekend maintenances \r\n Mailboxes maintenance (archiving)\r\n Interfaces with technical and process teams & understand technical support requirements\r\n  Complies with Standards & Procedures, Practices & Guidelines, Service Level Agreement\r\n', '2017-08-19 14:56:41', NULL, NULL, NULL, b'1'),
	('SK0002', 'Work', '<p>Monitoring of Transaction Analysis</p>\\n<p>Monitoring of error handling portal</p>\\n<p>Assigning tickets to onsite analyst</p>\\n<p>Resolving / clarifying customer request email&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Debugging &amp; doing RCA</p>\\n<p>Updating of emails in WFMDB</p>\\n<p>Advanced technical issues (Level 2) handled by them&nbsp;Implementing automation process in the client application</p>', NULL, NULL, NULL, NULL, b'1'),
	('SK0003', 'Work', ' Monitoring of Transaction Analysis\r\n Monitoring of error handling Portal\r\n Assigning tickets to onsite analyst\r\n Resolving / clarifying customer request emails\r\n Debugging & doing RCA of issues\r\n Advanced technical issues (Level 2) handled by them\r\n Implementing automation process in the client application', NULL, NULL, NULL, NULL, b'1'),
	('SK0004', 'Work', ' Design, implement, test and deploy various IT Service Management modules like Incident, Problem, Change, Knowledge, Release Management.', NULL, NULL, NULL, NULL, b'1'),
	('SK0005', 'Work', 'Analyzing Information \nProgramming Skills(Javascript, webservices using APIs,Single Sign on)\nSoftware Debugging\nSoftware Documentation\nSoftware Testing\nProblem Solving\nTeamwork\nSoftware Development Fundamentals\nSoftware Development Process\nAgile Process', NULL, NULL, NULL, NULL, b'1'),
	('SK0006', 'Work', '<p>Analyzing Information General Programming Skills Software Design Software Debugging Software Documentation Software Testing Problem Solving Teamwork Software Development Fundamentals Software Development Process Software Requirements.</p>', NULL, NULL, NULL, NULL, b'1'),
