	('SK0073', 'Tech', '1. Should have knowledge of common debugging tools of environment used\r\n2. Should be able to trace the bug by using a tool in logical sequence\r\n3. Troubleshoot and develop technical solutions for customer problems related to software and setup errors.\r\n4. Coordinate with other team members\r\n5. Troubleshoot simple code \r\n6. Make simple code defect fixes as necessary\r\n7. Create and execute unit testing scripts as needed to support the Development team.', NULL, NULL, NULL, NULL, b'1'),
