	('SK0078', 'Tech', '1. Understand the concepts about business use cases/logical data modelling    \r\n2. Should have a minimum knowledge of the technology used in that domain   \r\n3. Able to perform use case modelling with or without tools (RequistePro)   \r\n4. Knowledge of modelling tools & techniques (eg. UML, BPEL) (NA for ERP) \r\n5. Documents requirements specificiation as per the given standard templates\r\n6. Creates and updates traceability matrix', NULL, NULL, NULL, NULL, b'1'),
