	('SK0141', 'Tech', '1. Able to detect highly complex bugs\r\n2. Able to analyze and document bug resolution, that is, solution\r\n3. Troubleshoot high-level complexity of code \r\n4. Mentor associates in troubleshooting concepts\r\n5. Building standards for fixing and troubleshooting code\r\n6. Can work on prevention', NULL, NULL, NULL, NULL, b'1'),
	('SK0142', 'Tech', '1. Create multiple technical or functional/business solutions based on the requirements and manage exceptional conditions\r\n2. Ability to redesign with minimum impact\r\n3. Ability to break down problem into multiple design modules\r\n4. Aware of standard design approach and methodologies and has used them\r\n5. Has experience in designing complex solutions based on the requirements\r\n6. Can also review and propose improvements in other peoples design\r\n7. Awareness of design principles, methodologies, notations, patterns, tools, and techniques\r\n8. Ensures that the standards are being followed\r\n9. Guide other associates in creating designs\r\n10. Ensure that coding is as per the design and meets the requirements ', NULL, NULL, NULL, NULL, b'1'),
	('SK0143', 'Tech', '1. Your document received rave reviews from customers\r\n2. Is well versed in documentation language (business language) and makes minimum grammatical errors and uses simple language structure\r\n3. Possesses clarity of description and follows a proper sequencing in all documents to enable the reader to understand the program with least effort', NULL, NULL, NULL, NULL, b'1'),
	('SK0144', 'Lead', '1. Understands the need for a disciplined approach for selecting tools and services\r\n2. Aware of the process for vendor evaluation and selection\r\n3. Familiar with approved vendor list\r\n4. Understands the implications of improper selection\r\n5. Identifies key concepts behind service agreements\r\n6. Understands the service agreements in place between DISYS and the customer\r\n7. Identifies types of service available\r\n8. Knows where and how to obtain more information on services and related issues', NULL, NULL, NULL, NULL, b'1'),
	('SK0145', 'Lead', '1. Explains the concepts of phase, activity, and task\r\n2. Explains the concepts of deliverables, resources, dependencies\r\n3. Understands what can be tracked\r\n4. Aware of project administration tools\r\n5. Explain the concepts of phase, activity, task, and deliverable\r\n6. Able to track own tasks and activities\r\n7. Is aware of  the  project definition requirements concept\r\n8. Is aware of  the  concept of critical path\r\n9. Is aware of the  with the DISYS Program Management Methodology', NULL, NULL, NULL, NULL, b'1'),
	('SK0146', 'Lead', '1. Understands the basic concepts of matrix management\r\n2. Understands the basic concepts of functional management\r\n3. Defines  individual roles required to complete project tasks', NULL, NULL, NULL, NULL, b'1'),
	('SK0147', 'Lead', '1. Understands and can explain the basic principles of risk management\r\n2. Identifies contingency in cost estimate\r\n3. Understands and can explain the uses of contingency\r\n4. Understands and can explain the detailed planning requirements for more risk-prone projects', NULL, NULL, NULL, NULL, b'1'),
	('SK0148', 'Lead', '1. Explains the concept of project scope and differentiate between high-level and detailed-level scope requirements\r\n2. Differentiates  between in scope and out of scope work\r\n3. Differentiates  between the scope management process and the change management process\r\n4. Is aware of importance of project scope statement in meeting customer requirements', NULL, NULL, NULL, NULL, b'1'),
	('SK0149', 'Lead', '1. Understands the units of work and cost on which an estimate should be calculated\r\n2. Is able to query technical experts to obtain an estimate of the amount of time necessary to complete a task\r\n3. Is able to understand the WBS at the task level\r\n4. Is aware of the benefits of establishing and reusing estimating standards\r\n5. Is able to interpret current project status by reading the project schedule\r\n6. Is able to update existing schedules on a regular basis to assess planned progress against actual progress\r\n7. Revises schedule as directed by technical managers and ensures that schedule changes are communicated to all project team members\r\n8. Is aware of the importance of schedule variance analysis and schedule progress validation', NULL, NULL, NULL, NULL, b'1'),
	('SK0150', 'Lead', '1. Explains  the basic concepts behind the need to manage existing contracts\r\n2. Describes the responsibilities of the contracts administration function\r\n3. Identifies and interprets regular contracts administration reports', NULL, NULL, NULL, NULL, b'1'),
	('SK0151', 'Lead', '1. Understands and can explain the basic concept of integration of project planning and management\r\n2. Explains the concepts of integration of technical solutions for projects and programs\r\n3. Understands and can explain the communication requirements for an integrated project or program\r\n4. Understands the requirements for cost control and budgeting as they relate to cost and schedule integration\r\n5. Understands the concept of change management thresholds for a particular project plan\r\n6. Understands the process for changing baseline\r\n7. Acts as the focal point for change requests to the baseline and enters change requests into the change process\r\n8. Understands the different levels of the Work Breakdown Structure (WBS) and the level required for change control for a particular project', NULL, NULL, NULL, NULL, b'1'),
	('SK0152', 'Lead', '1. Has knowledge  of what quality software is and is not\r\n2. Has a conceptual  understanding of what comprises quality management\r\n3. Understands the principles of quality management and assurance principles\r\n4. Is aware of what own functions are measured\r\n5. Is aware of current means of quantifying and measuring the quality\r\n6. Is aware of current means of quantifying and measuring productivity', NULL, NULL, NULL, NULL, b'1'),
	('SK0153', 'Lead', '1. Understands the financial reporting system at DISYS and how cost is processed\r\n2. Able to create a spreadsheet that reflects costs by cost center and month for the project\r\n3. Researches cost that is unanticipated or greater than anticipated for validation\r\n4. Creates time tracking reports for analysis', NULL, NULL, NULL, NULL, b'1'),
	('SK0154', 'Lead', '1. Understands when an exception to policy, procedure, or standard may be warranted\r\n2. Understands the review and approval processes and procedures\r\n3. Identifies and  prioritizes  needed functions and features\r\n4. Familiar with stated requirements, including local selection criteria and standards\r\n5. Has reviewed a particular aspect of a product / service (functionality, performance...)\r\n6. Identifies major aspects of a service agreement\r\n7. Describes types of support covered by a specific agreement\r\n8. Describes types of support NOT covered by a specific agreement\r\n9. Understands the operational issues and considerations\r\n10. Identifies relevant standards, policies, and practices', NULL, NULL, NULL, NULL, b'1'),
	('SK0155', 'Lead', '1. Assists with planning, estimating, and controlling techniques for specific activities\r\n2. Familiar with project administration tool and reporting capabilities\r\n3. Understands local tools and reporting requirements\r\n4. Documents meeting, coordinates status reports and approvals on deliverables\r\n5. Coordinates status reports, minutes, etc. for user management and IS\r\n6. Participates in preparing and executing the overall project plan\r\n7.  Estimates, plan, and manages own tasks using project management tools\r\n8. Relates own tasks to others on project and to the projects critical path\r\n9. Assists team members in planning, estimating, and controlling specific activities\r\n10. Maintains open communications among project participants and affected parties\r\n11. Understands the benefits of using the DISYS Program Management Methodology', NULL, NULL, NULL, NULL, b'1'),
	('SK0156', 'Lead', '1. Understands the dynamics of matrix and functional organizations\r\n2. Works  through informal channels in order to obtain information\r\n3. Understands communications methodology utilized in program environment\r\n4. Works with informal work teams, often consisting of DISYS / client blended teams in order to expedite and status task information', NULL, NULL, NULL, NULL, b'1'),
	('SK0157', 'Lead', '1. Has experience in performing analysis of risk for a specific environment\r\n2. Has experience in performing analysis of impact of risk occurrence for specific environment\r\n3. Has experience in incorporating risk mitigation strategy for specific environment\r\n4. Has experience in creating contingency plan required for specific environment\r\n5. Has experience in establishing contingency in the baseline for a specific environment', NULL, NULL, NULL, NULL, b'1'),
	('SK0158', 'Lead', '1. Has participated in definition of scope as a group member\r\n2. Is able to explain in scope versus out of scope work for a particular project to technical personnel\r\n3. Is able to differentiate between project and program scope\r\n4. Is able to identify out of scope work at the project level\r\n5. Is able to break high-level tasks into lower-level tasks', NULL, NULL, NULL, NULL, b'1'),
	('SK0159', 'Lead', '1. Has participated in the calculation of a time and cost estimate for a project\r\n2. Is able to quantify and validate estimating metrics for a sub-project\r\n3. Is able to calculate remaining work required to complete an in-process task\r\n4. Is able to estimate materials costs based on historic information\r\n5. Performs schedule variance analyses\r\n6. Is able to monitor schedule deviations and assist in the development of alternative methods for corrective action at the project level\r\n7. Has experience in the creation of project schedules at the lowest level of detail through interviewing technical personnel and other project team members\r\n8. Is able to assess impact of critical path and near-critical activities at the project level and reports critical work activities to the PM\r\n9. Creates and maintains the master schedule under guidance of experienced Project Managers (PMs)', NULL, NULL, NULL, NULL, b'1'),
	('SK0160', 'Lead', '1. Has worked with the administration of local relevant contracts\r\n2. Describes the types of information required before a contract is signed\r\n3. Understands the  standards, procedures, and practices for recordkeeping of contractual agreements\r\n4. Locates relevant information for a specific vendor, customer, or contract\r\n5. Describes and summarizes major types of existing contracts', NULL, NULL, NULL, NULL, b'1'),
	('SK0161', 'Lead', '1. Combines technical product components in a manner that best achieves the requirements\r\n2. Combines  schedules so that all related work that has an impact on the project is included in the schedule\r\n3. Integrates the individual project plans into the master plan at the lowest level of detail\r\n4. Maintains the integration level defined by the program manager\r\n5. Performs assessment of change request\r\n6. Discusses  change requests with the project team\r\n7. Documents  the impact of a change request in terms of scope, resources, and schedule\r\n8. Creates  a recommended action plan for a change request based on assessment\r\n9. Documents recommendations for change prior to escalation', NULL, NULL, NULL, NULL, b'1'),
	('SK0162', 'Lead', '1. Understands and adheres to the companys quality management processes and practices\r\n2. Is familiar with quality evaluation tools and techniques (e.g., walkthroughs, inspections)\r\n3. Participates in quality assurance activities\r\n4. Has working knowledge of quality assurance methods, tools, and techniques\r\n5. Is aware of key measurements for own function or specialization\r\n6. Understands short-range and long-range improvement goals for own function\r\n7. Is  familiar  with action plans developed to achieve those goals\r\n8. Understands and evaluates key measurements for own function\r\n9. Interprets and analyzes measurement data reports', NULL, NULL, NULL, NULL, b'1'),
	('SK0163', 'Lead', '1. Performs analysis of spreadsheets that reflect actual vs. planned cost at the project level\r\n2. Performs analysis of estimated versus actual labor by month\r\n3. Creates reports for review that show labor and cost variance\r\n4. Assess impact of labor and cost variances\r\n5. Creates and maintains baseline cost estimate at the project level', NULL, NULL, NULL, NULL, b'1'),
	('SK0164', 'Lead', '1. Details overall considerations, including risk, and provide a recommendation\r\n2. Produces a written recommendation detailing candidates; benefits and drawbacks\r\n3. Develops a questionnaire for seeking reference information\r\n4. Has in-depth experience in evaluating products / services from multiple vendors\r\n5. Designs and communicates selection requirements (functionality, performance, etc.)\r\n6. Conducts  and summarizes a reference interview from current users in the marketplace\r\n7. Has experience with multiple types of service agreements\r\n8. Has in-depth knowledge of major features, functions, and facilities for different types of service\r\n9. Describes key benefits and drawbacks of different types of service\r\n10. Discuss legal and operational considerations of different types of service agreements\r\n11. Has participated in designing service classes, associated pricing, and best practices\r\n12. Speaks to relationships and interdependencies of different service offerings', NULL, NULL, NULL, NULL, b'1'),
	('SK0165', 'Lead', '1. Reports dependencies, conflicts, and completion dates to project management team\r\n2. Develops cost / benefit analysis and tracks and reviews actual costs and benefits\r\n3. Monitors progress and generates project variance analysis reports\r\n4. Has in-depth knowledge of project administration software\r\n5. Implements communications and reporting requirements to and from affected parties\r\n6. Plans and tracks multiple or complex project involving many activities and deliverables\r\n7. Has experience in monitoring project plans, critical path, and risk areas\r\n8. Has experience in defining and implementing proactive or corrective steps on projects and / or programs\r\n9. Has experience in periodic project reviews and other communications vehicles\r\n10. Has experience in identifying reporting requirements and creation of monitoring and control mechanisms\r\n11. Keeps abreast of project management tools, techniques, and innovations\r\n12. Serves as a resource to others to develop and implement project plans\r\n13. Has experience using and clearly understands the benefits of the DISYS Program Management Methodology', NULL, NULL, NULL, NULL, b'1'),
	('SK0166', 'Lead', '1. Creates discrete work teams responsible for accomplishing specific tasks or deliverables\r\n2. Determines the roles and responsibilities for DISYS and client work teams\r\n3. Establishes blended teams, when necessary, and establishes the process for work', NULL, NULL, NULL, NULL, b'1'),
	('SK0167', 'Lead', '1. Has experience in performing analysis of risk for a specific project or program\r\n2. Has experience in analysis of impact of risk occurrence for specific project or program\r\n3. Has experience in incorporating risk mitigation strategy for specific project or program\r\n4. Has experience in creating contingency plan required for specific project or program\r\n5. Has experience in establishing contingency in the baseline for a specific project or program', NULL, NULL, NULL, NULL, b'1'),
	('SK0168', 'Lead', '1. Is able to identify out of scope work at the project and program level\r\n2. Knows which competency or delivery area of DISYS is the appropriate group to review the scope for feasibility\r\n3. Is able to separate scope for validation by multiple technical review teams\r\n4. Is able to separate scope into discrete deliverables\r\n5. Is able to separate deliverables into high-level tasks\r\n6. Has experience in setting up roles and responsibilities matrix at the task and deliverable level', NULL, NULL, NULL, NULL, b'1'),
	('SK0169', 'Lead', '1. Has experience in leading an effort for estimating a large project or program\r\n2. Has experience in leading the post-implementation effort to validate the original program or project estimate against the actual and can identify / explain causes of schedule variance\r\n3. Is able to transfer knowledge from other project planning efforts and apply to the current effort\r\n4. Is able to validate estimating metrics with technical teams\r\n5. Is able to fine-tune level of detail for estimate based on the project risk factors\r\n6. Is able to create a schedule for an individual project by facilitating discussion of a large group of people with diverse skill sets\r\n7. Understands the importance of the change control process and schedule variance reporting\r\n8. Has experience in the approval of summary schedule for individual projects\r\n9. Is able to assess the impact of critical path and near-critical activities at the program level and reports critical work activities to the PM\r\n10. Is able to manage schedule reporting, milestone reporting, and validation of progress reported\r\n11. Analyzes schedule trends and develops options for corrective actions', NULL, NULL, NULL, NULL, b'1'),
	('SK0170', 'Lead', '1. Manages and administrates  of a wide variety of contracts\r\n2. Has solid knowledge of the  practices and considerations for upgrading existing contracts\r\n3. Cites examples of and discuss specific contract disputes\r\n4. Discusses the  characteristics of effective and ineffective contracts\r\n5. Describes  operations issues and considerations in contract enforcement', NULL, NULL, NULL, NULL, b'1'),
	('SK0171', 'Lead', '1. Combines schedules so that all work on the project that is related to other efforts is included in the schedule at the highest level\r\n2. Executes the policies set forth for the program / project in resource management, risk management, contract management, communications management for the integrated effort\r\n3. Creates an integrated view of project / program priorities, issues, definitions\r\n4. Directs the integration of the individual project plans into the master plan in accordance with priorities set\r\n5. Recommends the WBS levels for change control for projects\r\n6. Has led teams in assessment of change impact on other projects or programs\r\n7. Escalates requested change actions to the change boards in accordance with the policies and procedures\r\n8. Integrates the change board action into the master project plan', NULL, NULL, NULL, NULL, b'1'),
	('SK0172', 'Lead', '1. Describes the key benefits of quality management process\r\n2. Has experience in quality assurance activities at all phases of a projects\r\n3. Has expertise  in quality assurance tools, techniques, and standards\r\n4. Interprets results of quantitative and statistical tools\r\n5. Conducts and directs application reviews\r\n6. Monitors improvement efforts in quality and productivity\r\n7. Has experience in data collection, analysis, and reporting tools\r\n8. Discusses relationship of key metrics in own function to metrics in other functions\r\n9. Understands recognized industry benchmarks\r\n10. Has experience in  defining, capturing, and monitoring metrics for multiple functions\r\n11. Has in-depth knowledge of metrics used in all major functional areas', NULL, NULL, NULL, NULL, b'1'),
	('SK0173', 'Lead', '1. Generates  a cost accounting structure that is adequate to manage the cost for a specific project in accordance with program guidelines\r\n2. Understands the importance of the chance control process and variance reporting\r\n3. Assesses the estimate to complete for tasks at the program level\r\n4. Manages cost reporting, variance analysis, and maintenance of the cost of baseline at the program level\r\n5. Analyzes cost trends and recommends corrective actions or change action', NULL, NULL, NULL, NULL, b'1'),
	('SK0174', 'Lead', '1. Develops a comparative analysis of all the products under consideration\r\n2. Plays a lead role in defining the product / service evaluation process and selection criteria\r\n3. Analyzes recommendations from professionals, vendor personnel, and references\r\n4. Develops a solid business case summarizing findings and offering recommendation\r\n5. Leads selection and approval of vendor candidates for evaluation\r\n6. Stays informed on vendors, specific product histories, trends, and directions\r\n7. Has experience designing, implementing, and operating various types of service agreements\r\n8. Has experience architecting policy, strategy, and best practices for service agreements\r\n9. Has influence on wide or high-impact customer service decisions or initiatives\r\n10. Has experience with bundling different types of service classes\r\n11. Has a theoretical background and understanding of service support\r\n12. Speaks to the historical and future perspective of service agreements and support requirements', NULL, NULL, NULL, NULL, b'1'),
	('SK0175', 'Lead', '1. Organizes efficient processing of work requests, securing estimates, and responses to users\r\n2. Plans and tracks multiple projects involving many activities and deliverables\r\n3. Maintains a structured approach for progress monitoring and reporting.\r\n4. Issues status reports and documentation\r\n5. Identifies, communicates, and resolves conflicting schedules and dependencies\r\n6. Evaluation, selects, and implements project management software\r\n7. Establishes best practices for project administration\r\n8. Provides project management consulting and educational support\r\n9. Monitors critical path of major projects; implements corrective actions\r\n10. Champions DISYS Program Management Methodology, tools, and techniques\r\n11. Has experience in consulting on project planning and management on high-risk, high-cost, high-impact projects\r\n12. Ensures efficient utilization of resourcestechnical, administrative and otherwise\r\n13. Resolves contractual issues involving technology vendors and consultants\r\n14. Has experience in the management of programs and / or projects with major impact, risk, or value to the organization', NULL, NULL, NULL, NULL, b'1'),
	('SK0176', 'Lead', '1. Defines the project / program strategic vision with regard to the organization of the projects within a specific program\r\n2. Determines the right organizational model required to complete project / program objectives\r\n3. Determines the deliverables and responsibilities of each project and establishes the prioritization process for the program\r\n4. Resolves contractual issues with regard to project / program organization with the account manager and the client', NULL, NULL, NULL, NULL, b'1'),
	('SK0177', 'Lead', '1. Has experience in establishing a risk management strategy for a project or program\r\n2. Controls the use of identified contingency funds in response to a risk event\r\n3. Communicates  the impact of risk factors on project execution to client and account manager\r\n4. Oversees  the risk management planning for the project or program\r\n5. Resolves contractual issues with regard to risk management with the account manager and the client\r\n6. Monitors the response system for risk management', NULL, NULL, NULL, NULL, b'1'),
	('SK0178', 'Lead', '1. Has experience in the approval of the project and program scope statements\r\n2. Is able to align the project and program scope statements with the account/ customer strategies\r\n3. Has experience in consulting on the definition of project scope with accounts/customers in order to produce scope statements, which are specific and deliverable with DISYS resources or other entities\r\n4. Has experience in setting up the organization and identifying the responsible parties for delivery at the project level\r\n5. Has experience in resolution of contractual issues with regard to scope with the account manager and the client', NULL, NULL, NULL, NULL, b'1'),
	('SK0179', 'Lead', '1. Has experience in approving the overall estimate and the level of detail used\r\n2. Is able to be responsible for setting up an estimating organization for the project and auditing the estimate during the execution phase\r\n3. Has experience in the resolution of contractual issues with regard to the estimate with the account manager and the client\r\n4. Has experience in the approval of the summary schedule for programs or large projects\r\n5. Has experience in the approval of changes to the master schedule that exceed the variance threshold\r\n6. Establishes the appropriate variance threshold for the project based on the project risk and customer expectations\r\n7. Is able to understand high-level variance reporting and the options available to the team for successful completion of the project\r\n8. Is able to and has experience in resolving contractual issues with regard to schedule with the account manager and the client', NULL, NULL, NULL, NULL, b'1'),
	('SK0180', 'Lead', '1. Has significant experience with managing enterprise-level contracts function\r\n2. Monitors the companys experience with contracts, contact disputes, and litigation\r\n3. Has played a leadership role in defining the processes and tools for contacts administration\r\n4. Discusses contractual considerations vis--vis organizational restructuring\r\n5. Monitors the companys experience with contracts and relevant processes\r\n6. Has knowledge  of industry trends and experiences on contracts management', NULL, NULL, NULL, NULL, b'1'),
	('SK0181', 'Lead', '1. Defines the project / program strategic vision with regard to prioritization between projects / programs\r\n2. Establishes policies for resource management, risk management, contract management, and communications management for the integrated effort\r\n3. Reviews integrated information on a regular basis to ensure that priorities are appropriate\r\n4. Resolves contractual issues with regard to project / program integration with the account manager and client\r\n5. Has experience in establishing change boards and the level of change control for projects\r\n6. Communicates impacts of risk factors on project execution to both clients and account managers\r\n7. Resolves contractual issues with regard to change control with the account manager and the client', NULL, NULL, NULL, NULL, b'1'),
	('SK0182', 'Lead', '1. Consults to Business Unit groups on quality metrics practices, guidelines, policies, and procedures\r\n2. Directs development of guidelines, policies, and procedures\r\n3. Is an expert  in the theory and practice of quality management\r\n4. Monitors industry and marketplace for quality management best practices and tools\r\n5. Monitors company and industry experience; identifies improvement opportunities\r\n6. Provides consulting assistance for quality management activities for key projects\r\n7. Is knowledgeable in the theory and practice of micro and macro metrics\r\n8. Coaches / teaches others in the significance, value, and use of metrics\r\n9. Monitors marketplace for quantitative and statistical measurement practices and tools\r\n10. Devises, interprets, and analyzes measurable success of improvement efforts\r\n11. Consults to business executives on quantifying effectiveness of the Business Unit functions and activities\r\n12. Develops effective measurements and implements data capture and reporting programs\r\n13. Consults on strategies and implementation of measurement', NULL, NULL, NULL, NULL, b'1'),
